import React from 'react';
import DashboardV from './src/Dashboard';
import HeaderV from './src/Header';
import LineChartV from './src/LineChart';
import RadarChartV from './src/RadarChart';

function App() {
  return (
    <div style={{backgroundColor:'#eee'}}>
      <HeaderV/>
      <div style={{display:'flex'}} >
        <div style={{height:'100vh'}}>
        <DashboardV/>
        </div>

      <div style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </div>

     <div style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
       <RadarChartV/>
     </div>

      </div>
      <div style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </div>

      <div style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </div>


    </div>



  );
}

export default App;
